import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './app.js';


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
ReactDOM.render(<App />, document.getElementById('root'));
